import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import "./review.css";
import { faStar } from "@fortawesome/free-solid-svg-icons";
import axios from "axios";
import { useState } from "react";

const Review = () => {
  const [feedback, setFeedback] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [star, setStar] = useState(1); // Giá trị mặc định

  const handleSubmit = async () => {
    try {
      const response = await axios.post("/api/reviews", {
        feedback,
        username,
        email,
        star,
      });
      console.log("Review submitted:", response.data);
      // Reset các trường sau khi submit thành công
      setFeedback("");
      setUsername("");
      setEmail("");
      setStar(1);
      // Sau khi submit, cần fetch lại dữ liệu nếu cần thiết
      // Ví dụ: reFetch();
    } catch (error) {
      console.error("Error submitting review:", error);
    }
  };
  return (
    <div className="review">
      <div className="titleReview">
        <h2>Đánh giá khách hàng</h2>
      </div>
      <div className="containerReviews">
        <div className="cardReview">
          <div className="boxReview">
            <div className="revCustomer">
              <h4 className="cusName">Customer1</h4>
              <span className="ratingNumber">
                4/5
                <FontAwesomeIcon icon={faStar} />
              </span>
            </div>
            <div className="descReview">
              “Thái độ của các nhân viên rất chu đáo, hỗ trợ mình rất nhiều kể
              cả khi mình đã check out phòng từ 2h chiều mà tận 8h tối bọn mình
              mới rời khỏi khách sạn để ra sân bay”
            </div>
          </div>
        </div>
      </div>
      <div className="writeReview">
        <h3 style={{ marginBottom: "20px" }}>Write a review</h3>
        <div className="containerComment">
          <div className="feedback">
            <label>Feedback</label>
            <textarea
              id="feedback"
              className="inputFeedback"
              placeholder="Viết đánh giá tại đây..."
              value={feedback}
              onChange={(e) => setFeedback(e.target.value)}
            ></textarea>
          </div>
          <div className="inputInfo">
            <div className="infInput">
              <label htmlFor="">Họ tên</label>
              <input
                type="text"
                className="inputText"
                placeholder="Họ và tên"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
            <div className="infInput">
              <label htmlFor="">Email</label>
              <input
                type="text"
                className="inputText"
                placeholder="Email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className="infInput">
              <label htmlFor="">Đánh giá</label>
              <select
                id="rating"
                className="inputRating"
                value={star}
                onChange={(e) => setStar(parseInt(e.target.value))}
              >
                <option value="1">1</option>
                <option value="2">2</option>
                <option value="3">3</option>
                <option value="4">4</option>
                <option value="5">5</option>
              </select>
            </div>
          </div>
        </div>
      </div>
      <div className="buttonHandle">
        <button type="button" className="submit" onClick={handleSubmit}>
          Xác nhận
        </button>
      </div>
    </div>
  );
};

export default Review;
